import React from 'react'
import {Route,Routes} from 'react-router-dom'
import Login from './components/Login'
const App = () => {
  return (
    <div>
      <Routes>
        <Route element={<Login/>} path='/login'></Route>
      </Routes>
    </div>
  )
}

export default App
